export default (function(a,b,c,d,e){return {data:{"6P8revj02r":{data:{id:708,attributes:{imdbId:"tt3104988",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTYxNDMyOTAxN15BMl5BanBnXkFtZTgwMDg1ODYzNTM@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Rotten Tomatoes",Value:"90%"},{Source:"Metacritic",Value:"74\u002F100"}],item_lang:{data:{id:1371,attributes:{title:d,plot:"Rachel Chu, an American-born Chinese NYU professor, travels with her boyfriend, Nick to his hometown of Singapore for his best friend's wedding. Before long, his secret is out: Nick's family is wealthy, and he's considered the most eligible bachelor in Asia. Every single woman is incredibly jealous of Rachel and wants to bring her down.",slug:"crazy-rich-asians"}}},books:{data:[{id:4630,attributes:{title:"The Crazy Rich Asians Trilogy Box Set",description:"The New York Times bestselling Crazy Rich Asians series reveals the outrageous world of high-net-worth society with humor and heart. Crazy Rich Asians is now a major motion picture. “There’s rich, there’s filthy rich, and then there’s crazy rich.” —People New Yorker Rachel Chu does not know that her loving boyfriend, Nicholas Young, also happens to be Singapore’s most eligible bachelor and likely heir to a massive fortune. So when she agrees to spend the summer in Nick’s home, her life unexpectedly becomes an obstacle course of old money, new money, nosy relatives, and scheming social climbers. And that’s all before she discovers the true identity of her long-lost father . . . This box set includes the entire trilogy: Crazy Rich Asians, China Rich Girlfriend, and Rich People Problems.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ga1oDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2018-08-21",publisher:e,subtitle:"Crazy Rich Asians; China Rich Girlfriend; Rich People Problems"}},{id:4631,attributes:{title:d,description:"THE OFFICIAL MOVIE TIE-IN EDITION: Soon to be a major motion picture from Warner Brothers, the funny, juicy first novel in the bestselling Crazy Rich Asians trilogy, in which the heir to one of the most massive fortunes in Asia brings his ABC (American-born Chinese) girlfriend home to meet the family ... without telling her that they're loaded. When Rachel Chu agrees to spend the summer in Singapore with her boyfriend, Nicholas Young, she envisions a humble family home and quality time with the man she might one day marry. What she doesn't know is that Nick's family home happens to look like a palace, that she'll ride in more private planes than cars, and that with one of Asia's most eligible bachelors on her arm, Rachel might as well have a target on her back. Uproarious, addictive, and filled with jaw-dropping opulence, Crazy Rich Asians is an insider's look at the Asian jet set; a perfect depiction of the clash between old money and new money; and a fabulous novel about what it means to be young, in love, and gloriously, crazily rich.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MwkgtQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2018-07-17",publisher:"Anchor Canada",subtitle:a}},{id:4632,attributes:{title:d,description:"A hilarious and heartwarming New York Times bestselling novel—the basis for the acclaimed major motion picture! \"There's rich, there's filthy rich, and then there's crazy rich ... A Pride and Prejudice-like send-up about an heir bringing his Chinese-American girlfriend home to meet his ancestor-obsessed family.” –PEOPLE When New Yorker Rachel Chu agrees to spend the summer in Singapore with her boyfriend, Nicholas Young, she envisions a humble family home and quality time with the man she hopes to marry. But Nick has failed to give his girlfriend a few key details. One, that his childhood home looks like a palace; two, that he grew up riding in more private planes than cars; and three, that he just happens to be the country’s most eligible bachelor. On Nick’s arm, Rachel may as well have a target on her back the second she steps off the plane, and soon, her relaxed vacation turns into an obstacle course of old money, new money, nosy relatives, and scheming social climbers. Look for Kevin Kwan’s latest novel, Sex & Vanity!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LrFYL6NFjU8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2013-06-11",publisher:e,subtitle:a}},{id:4633,attributes:{title:"Kevin Kwan Crazy Rich Asians Trilogy Collection 3 Books Set Pack (Crazy Rich Asians, China Rich Girlfriend, Rich People Problems).",description:a,thumbnail:a,authors:[b],firstBook:c,published:"2017-01-01",publisher:a,subtitle:a}},{id:4634,attributes:{title:"China Rich Girlfriend",description:"From the bestselling author of Crazy Rich Asians (the basis for the acclaimed major motion picture) comes a deliciously fun story of family, fortune, and fame in Mainland China. Book Two of the Crazy Rich Asians Trilogy It’s the eve of Rachel Chu’s wedding, and she should be over the moon. She has a flawless Asscher-cut diamond, a wedding dress she loves, and a fiancé willing to thwart his meddling relatives and give up one of the biggest fortunes in Asia in order to marry her. Still, Rachel mourns the fact that her birthfather, a man she never knew, won’t be there to walk her down the aisle. Then a chance accident reveals his identity. Suddenly, Rachel is drawn into a dizzying world of Shanghai splendor, a world where people attend church in a penthouse, where exotic cars race down the boulevard, and where people aren’t just crazy rich … they’re China rich. Look for Kevin Kwan’s latest novel, Sex & Vanity!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uNiWBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2015-06-16",publisher:e,subtitle:"A Novel"}}]}}},meta:{}}},prerenderedAt:1680940950059}}("","Kevin Kwan",null,"Crazy Rich Asians","Anchor"))